Cast: Karlie Montana, Misha Cross, Dana DeArmond, Sara Luvv, Nikki Hearts, Sinn Sage, Charlotte Stokely, Lily Cade

Sweetheart proudly presents a brand new series that explores the popular theme of lesbians in lock up. Each story is unique, and captures the urgency, passion and hunger of gorgeous lesbians in trouble. A spoiled, celebrity brat, Sara Luvv, has gone too far with her public recklessness, and gets a strong attitude adjustment from her public defender, Dana DeArmond. Beautiful prostitute Misha Cross commiserates with fellow inmate Karlie Montana, just before she is deported back to Warsaw, into the worst prison in Eastern Europe. Prison doctor Sinn Sage tries to figure out why three strike offender Nikki Hearts keeps having seizures, and finally escaped convicts Lily Cade &amp; Charlotte Stokely enjoy each other one last time as they are surrounded by police, facing certain execution.

